,1616152786867,null,null,[\"/url?q\\u003dhttps://www.google.com/maps/contrib/111817599807163781961/reviews%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IPSgBMAA\\u0026usg\\u003dAOvVaw33U98MD2Hb8OwCUBdAzD06\",\"桜島GT\",\"https://lh3.googleusercontent.com/a-/AOh14GhzwIkHFB_YrJKOj8UDnVmB-wRP3oNz97odRHbxqA\\u003dc0x00000000-cc-rp-ba6\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IPSgBMAA\"]\n,\"EgIIAQ\"]\n,[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/101097930554020800447%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IWCgAMAA\\u0026usg\\u003dAOvVaw37yTMA0qlVRfrn0AUzBc46\",\"Ryuichi Kozaki\",\"https://lh3.googleusercontent.com/-pD2gQxiyu74/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckgqbhpGMYZCan_7y5bDW1UILxKAw/c0x00000000-cc-rp-ba8/photo.jpg\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IWCgAMAA\"]\n,\"2 か月前\",null,\"琉球八社（琉球王府から特別の扱いを受けた8つの神社）の一つ。パワースポット。その名の通り、青い海を見渡す崖の上に立つ沖縄らしいフォトジェニックな神社。ゆいレール「旭橋駅」より徒歩15分。オリジナル御朱印帳がある。\\n\\n波の上ビーチと隣接している。写真を撮るならビーチから公園を抜けて、波之上臨海道路からのアングルが最高。間違いなく映える。\\n\\n沖縄を代表する初詣場所。琉球国新一の宮（ある地域の中で最も社格の高いとされる神社）に認定されている。愛称は「なんみんさん」・「ナンミン」として親しまれている。\\n\\n恋愛成就や良縁祈願、安産祈願が最も有名。その他、家内安全、厄除、商売繁盛、合格祈願、海上安全、幸運長寿等。一般的な御守の他に「フー札（フーフダ）」という沖縄独自の魔除けアイテムがある。\\n\\n波上宮から徒歩5分ほどの場所に人気のステーキレストラン「ステーキハウス88辻本店」がある。オススメ。\\n\\n新型コロナウイルス感染症拡大防止の為、マスク着用の参拝と、御朱印はオリジナル御朱印帳又は、書き置きの御朱印のみの対応になっている。※2020年12月時点\",4,null,\"101097930554020800447\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSURTNmZtNl9RRRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSURTNmZtNl9RRRIuChdDSUhNMG9nS0VJQ0FnSURTMF9iMXpnRRITQ2d3SXBZVGZfd1VRcUs3aTNBRRotChZDSUhNMG9nS0VJQ0FnSURTNmZtNkF3EhNDZ3dJMVBlMl93VVF5TXFXeGdNIhIJdT8KUYVp5TQRrCRV4eFRancqE0Nnd0lwWVRmX3dVUXFLN2kzQUU\\u0026wv\\u003d1\\u0026s\\u003d81\",\"違反コンテンツを報告\",null,\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQoykIWigCMAA\"]\n,null,null,\"ChdDSUhNMG9nS0VJQ0FnSURTNmZtNl9RRRAB\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4R4IVygBMAA\",[null,[[10,null,1]\n,1201,6041,\"https://lh3.go ull,[null,null,null,\"/local/business/mm/reviews/l/u17911004958186901494/reply?s\\u003dEAA%3D\\u0026ih\\u003dtactile\\u0026p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVUlRObVp0Tmw5UlJSQUIYAA%3D%3D\"]\n,null,[null,null,null,\"/local/business/mm/reviews/l/u17911004958186901494/deletereply?s\\u003dEAA%3D\\u0026ih\\u003dtactile\\u0026p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVUlRObVp0Tmw5UlJSQUIYAA%3D%3D\"]\n,null,null,null,null,null,null,null,null,null,null,null,null,null,1609415636952,null,null,[\"/url?q\\u003dhttps://www.google.com/maps/contrib/101097930554020800447/reviews%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IWSgBMAA\\u0026usg\\u003dAOvVaw27MKzAzY_MfizlCprAXeG_\",\"Ryuichi Kozaki\",\"https://lh3.googleusercontent.com/-pD2gQxiyu74/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckgqbhpGMYZCan_7y5bDW1UILxKAw/c0x00000000-cc-rp-ba8/photo.jpg\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IWSgBMAA\"]\n,\"EgIIAg\"]\n,[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/112650640326096649681%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IoAEoADAA\\u0026usg\\u003dAOvVaw3c_6s7oesxWcarscBfdZZZ\",\"カスケ\",\"https://lh3.googleusercontent.com/a-/AOh14Gi1zmrxfJ89UG8QV5V2QHfid7_3GjH7QH3otfHxwA\\u003dc0x00000000-cc-rp-ba5\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4h4IoAEoADAA\"]\n,\"1 か月前\",null,\"【御朱印：あり】\\n\\n那覇市若狭一丁目に鎮座する波上宮(なみのうえぐう)\\n1871年に制定された近代社格制度では官幣小社に列せされ、神社本庁の別表神社に指定される神社であり、全国一の宮会より琉球国新一の宮に認定されております。\\n\\n創建は不詳ですが、古来より海の彼方にある海神の国(ニライカナイ)の神々に祈りを捧げる儀式が沖縄の至る所で行われており、その内の一つがこの崖端(がけばた)で聖地とされていました。\\n\\n伝記によれば以下の縁起が伝わっております。\\n『往昔、南風原に崎山の里主なる者があって、毎日釣りをしていたが、ある日彼は海浜で不思議な”ものを言う石”を得た。\\n以後、彼はこの石に祈って豊漁を得ることができた。\\nこの石は光を放つ霊石で彼は大層大切にしていた。\\nこの事を知った諸神がこの霊石を奪わんとしたが里主は逃れて波上山(現在のご鎮座地／別名：花城(はなぐすく))に至った時に神託があった。\\n即ち、「吾は熊野権現也(くまのごんげんなり)この地に社を建ててまつれ、しからば国家を鎮護すべし」と。\\nそこで里主はこの事を王府に奏上し、王府は社殿を建てて篤く祀った』\\n\\nつまり御神体である霊石を大切にしていた人が、その霊石を様々な神様が奪おうとやってきたという所でお告げがあり「この地に奉ればこの国を護る」といわれ、琉球が主体となって社殿を建立したという伝承になる。\\n\\n沖縄は古来より御嶽(うたき)や理想郷信仰を指すニライカナイなど琉球神道としての文化が形成されており、本土の神道と混合した歴史があります。それを知る上で非常に興味深く、とても貴重であり、両者を取り入れて発展していく柔軟な風土をよく感じる事が出来ます。\\n\\n【御祭神】\\n主神\\n・伊弉冊尊(いざなみのみこと)\\n・速玉男尊(はやたまをのみこと)\\n・事解男尊(ことさかをのみこと)\\n相殿神\\n・竈神(かまどのかみ)／火神(ヒヌカン)\\n・産土大神(うぶすなのおおかみ)\\n・少彦名神(すくなひこなのかみ)／薬祖神\",5,null,\"112650640326096649681\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSUN5NVlIUHlRRRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSUN5NVlIUHlRRRIuChdDSUhNMG9nS0VJQ0FnSUN5NVlIUHFRRRITQ2d3STVhYjlnQVlRMEtDMHlBSRotChZDSUhNMG9nS0VJQ0FnSUN5NVlIUGFREhNDZ3dJNWFiOWdBWVEwS0MweUFJIhIJdT8KUYVp5TQRrCRV4eFRancqE0Nnd0k1YWI5Z0FZUTBLQzB5QUk\\u0026wv\\u003d1\\u0026s\\u003d81\",\"違反コンテンツを報告\",null,\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQoykIogEoAjAA\"]\n,null,null,\"ChdDSUhNMG9nS0VJQ0FnSUN5NVlIUHlRRRAB\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ4R4InwEoAjAA\",[null,[[7,null,1]\n,184,1042,\"https://lh3.googleusercontent.com/a-/AOh14Gi1zmrxfJ89UG8QV5V2QHfid7_3GjH7QH3otfHxwA\\u003dc0x00000000-cc-rp-ba5\",\"カスケ\",\"https://www.google.com/maps/contrib/112650640326096649681?hl\\u003dja-JP\",null,null,\"https://www.google.com/maps/contrib/112650640326096649681?hl\\u003dja-JP\"]\n,\"カ\"]\n,null,[[\"AF1QipMQZAxamCgDcqJ4OjLYOMqyKuXVAbYiIz7v62ZU\",null,null,null,null,null,[\"https://lh5.googleusercontent.com/p/AF1QipMQZAxamCgDcqJ4OjLYOMqyKuXVAbYiIz7v62ZU\\u003dw150-h150-k-no-p\"]\n,null,null,\"lLxfYKqrMoaMsQWClq3YDQ\",\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQzCcIowEoAzAA\",[\"//www.google.com/cbk?output\\u003dreport\\u0026cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u003d!1e10!2sAF1QipMQZAxamCgDcqJ4OjLYOMqyKuXVAbYiIz7v62ZU\",null,null,\"0ahUKEwiqxZeazdHvAhUGRqwKHQJLC9sQ-y4IpAEoADAA\"]\n,null,null,null,null,null,null,null,null,null,[[1]\n,[10,\"AF1QipMQZAxamCgDcqJ4OjLYOMqyKuXVAbYiIz7v62ZU\"]\n,[10,3,[4000,6000]\n,null,null,null,null,null,null,\"AF1QipMQZAxamCgDcqJ4OjLYOMqyKuXVAbYiIz7v62ZU\"]\n,[null,null,null,null,null,null,null,[\"波上宮\",\"ja\"]\n]\n,null,null,[2,0,null,null,null,[null,null,null,[6,7,4,1,3]\n]\n,null,[2018,11,2]\n,[2021,
